import Card from "./contacts";

function App(){
    return(
        <div>
            <Card 
            name = "Beyonce"
            img = "https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
            tel = "23274821"
            email = "b@beyonce.com"
            />
            <Card 
            name = "Jack"
            />
            <Card />
        </div>
    )
}
